import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
var timeAndDate = () => {
  const date = new Date();
  return `${date.getHours()}:${date.getMinutes()}:${date.getSeconds()} || ${date.getDate()}/${date.getMonth()}/${date.getFullYear()}`;
};
var taskArr = [
  {
    taskName: "Task_001",
    taskTime: timeAndDate(),
  },
  {
    taskName: "Task_002",
    taskTime: timeAndDate(),
  },
  {
    taskName: "Task_003",
    taskTime: timeAndDate(),
  },
];

function Output() {
  return (
    <div>
      {taskArr.map((task) => {
        return <Events data={task} />;
      })}
    </div>
  );
}
function Events(props) {
  var { taskName, taskTime } = props.data;
  return (
    <task>
      <taskName>{taskName}</taskName>
      <taskTime>{taskTime}</taskTime>
      <button>X</button>
    </task>
  );
}
ReactDOM.render(<Output />, document.getElementById("root"));
